import React from "react";

import Watch from "../svg/Watch";
import Cloche from "../svg/Cloche";
import Eye from "../svg/Eye";

const SignUp = () => {
  return (
    <div className="container">
      <h3>Pourquoi créer un compte ?</h3>
      <div className="watch">
        <div className="logo">
          {" "}
          <Watch />
        </div>

        <div className="text">
          <h4>Gagnez du temps</h4>
          <p>
            Gagnez du temps Publiez vos annonces rapidement, avec vos
            informations pré-remplies chaque fois que vous souhaitez déposer une
            nouvelle annonce.
          </p>
        </div>
      </div>
    </div>
  );
};

export default SignUp;
